// src/sections/Services/Services.jsx
import React from "react";
import styles from "./Services.module.css";
import FadeIn from "../../components/FadeIn";
import { FaCode, FaLaptopCode, FaMobileAlt, FaLock } from "react-icons/fa";

const services = [
  {
    title: "Web Application Development",
    description: "Developing dynamic web applications to streamline business processes.",
    icon: <FaCode />,
  },
  {
    title: "Web Development",
    description: "Creating responsive and user-friendly websites tailored to client needs.",
    icon: <FaLaptopCode />,
  },
  {
    title: "App Development",
    description: "Creating intuitive mobile applications that meet user needs and enhance engagement.",
    icon: <FaMobileAlt />,
  },
  {
    title: "Blockchain Development",
    description: "Leveraging blockchain technology to create secure and transparent applications.",
    icon: <FaLock />,
  },
];

const Services = () => {
  return (
    <section id="services" className={styles.services}>
      <FadeIn>
        <h2 className={styles.heading}>Our Services
          <span className={styles.underline}></span>
        </h2>
        <p className={styles.subheading}>
          We provide innovative web solutions that enhance user experiences and drive business success.
        </p>
        <div className={styles.servicesGrid}>
          {services.map((service, index) => (
            <div key={index} className={styles.card}>
              <div className={styles.icon}>{service.icon}</div>
              <h3>{service.title}</h3>
              <p>{service.description}</p>
            </div>
          ))}
        </div>
      </FadeIn>
    </section>
  );
};

export default Services;
